<p><hi rend="bold">Paus Felix I</hi> (lahir di <ref target="https://id.wikipedia.org/wiki/Roma">Roma</ref>, <ref target="https://id.wikipedia.org/wiki/Italia">Italia</ref>) adalah seorang <ref target="https://id.wikipedia.org/wiki/Paus_(Katholik_Roma)">Paus</ref>, pemimpin <ref target="https://id.wikipedia.org/wiki/Gereja_Katholik_Roma">Gereja Katholik Roma</ref>, <ref target="https://id.wikipedia.org/wiki/Uskup">uskup</ref> <ref target="https://id.wikipedia.org/wiki/Roma">Roma</ref> dari <ref target="https://id.wikipedia.org/wiki/5_Januari">5 Januari</ref> <ref target="https://id.wikipedia.org/wiki/269">269</ref> hingga <ref target="https://id.wikipedia.org/wiki/30_Desember">30 Desember</ref> <ref target="https://id.wikipedia.org/wiki/274">274</ref>.</p>
